import React from 'react';
import './App.css';
import { Container, Row, Jumbotron } from 'react-bootstrap';
import NavigationBar from './Components/NavigationBar';

function App() {
  return (
    <div className="App">
      <NavigationBar />
      <Container>
        <Row>
          <Jumbotron>
            <h1>Hello World!</h1>
            <p>
              Ceci est le corps de la page.
            </p>
          </Jumbotron>
        </Row>
      </Container>
    </div>
  );
}

export default App;
